import { Routes, Route } from 'react-router-dom';

//Import Routes


import {HomePage, ConceptsPage} from '../views/index';

const Home = <Route path="/" element={<HomePage/>}/>;
const Contents = <Route path='/contents/' element={<ConceptsPage/>}/>
const Error_404 = <Route path="*" element={<h1>ERROR 404 No se encuentra el documento</h1>}/>

const RoutesPage = [
    
    {
        path:"/",
        element:"<HomePage/>"
    },
    {
        path:"/contents/",
        element:"<ConceptsPage/>"
    },
    {
        path:"*",
        element:"<h1>ERROR 404 No se encuentra el documento</h1>"
    },

]

const RoutesPag = ()=>{
    return(
            <Routes>
                {
                    RoutesPage.map(value => {
                        return(
                            <Route path={value.path} element={<value.element/>}/>
                        )
                    })
                }
            </Routes>
    );
};

export {
    RoutesPag as PagApp
}
